import { Tile, Box, Title, Subtitle } from 'bloomer';

export default function TileItem({ name, subtitle }) {
    return (
        <Tile isParent>
            <Tile
                title={ title }
                subtitle={ subtitle }
                isChild
                render={
                    props => (
                        <Box {...props}>
                            <Title>{ props.title }</Title>
                            <Subtitle>{ props.subtitle }</Subtitle>
                        </Box>
                    )
                }
            />
        </Tile>
    );
}
